from datetime import datetime, timedelta

def parse_iso8601(date_str, delimiter='T', timezone=None):
    """ Return a UNIX timestamp from the given date.
        Delimiter corresponds to the time delimiter (e.g. 2023-10-19T00:00:00+0000)
    """
    try:
        if 'Z' in date_str:
            date_str = date_str.replace('Z', '+0000')
        dt_object = datetime.strptime(date_str, "%Y-%m-%d{}%H:%M:%S%z".format(delimiter))
        timestamp = (dt_object - datetime(1970, 1, 1, tzinfo=dt_object.tzinfo)) / timedelta(seconds=1)
        return int(timestamp * 1000)
    except ValueError as e:
        return None
